import React from "react";
import ReactDOM from "react-dom";
import history from '../History'

const Modal = props => {
  return ReactDOM.createPortal(
      <div  onClick={()=>history.push('/')} className="ui dimmer modals visible active fontify">
      <div onClick={(e)=>e.stopPropagation()} className="ui standard visible active w-25 h-25">
          <div className="card">
              <div className="card-header">
                 Delete Stream
              </div>
              <div className="card-body">
                  <p className="card-text">Are you sure you want to delete this item</p>
                  <button className="btn btn-sm btn-danger m-1">Delete</button>
                  <button className="btn btn-sm btn-dark">Cancel</button>
              </div>
          </div>
      </div>
  </div>
      , document.getElementById("modal"));
};

export default Modal;
